import React from "react";

function Page({ currentPage }) {
    return (
        <div className="page">
            <div className="datebox">
                <h2>{currentPage.date.day}</h2>
                <h2>{currentPage.date.month}</h2>
            </div>
            <p>{currentPage.entry}</p>
            <button onClick={() => console.log(currentPage)}>button</button>
        </div>
    )
}

export default Page;
